import './App.css';
import {BrowserRouter, Route, Routes } from "react-router-dom";
import Cursos from "./components/cursos/index.js";
import CrearCurso from "./components/crearCurso";
import Detalle from "./components/detalle";


function App() {
  return (
    <BrowserRouter> 
    <div className="App">
    <Routes>
    <h1>LarnU</h1>
        <Route path = "" element = {<Cursos />}/>
        <Route path= "/:id" element = {<Detalle />}/>
        <Route exact path = "/crear" element = {<CrearCurso />}/>
    </Routes>

    </div>
    </BrowserRouter>
  );
}

export default App;
